import React from 'react';
import michaelJacksonImage from '../assets/image.png'; // Importing the image from the src/assets folder

const ArtistCard = () => {
  return (
    <div className="artist-card">
      <img
        src={michaelJacksonImage} // Use the imported image
        alt="Michael Jackson"
        style={{
          width: '200px',
          height: '200px',
          borderRadius: '10px',
          marginRight: '20px',
        }}
      />
      <div>
        <h2>Michael Jackson</h2>
        <p>27,823,904 monthly listeners</p>
      </div>
    </div>
  );
};

export default ArtistCard;
